const PostWrapper = ({children, post}) => {
  return (
    <div className={styles.post_wrapper}>
  <article className={styles.post_main}>
  <h2>{post.title}</h2>
    {children}
  </article>
  <div className={styles.post_side_bar}>

  </div>
  </div>
  )
}

export default PostWrapper;
